import { useEffect,useState} from "react";
import axios from 'axios';
function Creators(){
    useEffect(()=>{
        axios.get('http://localhost/5001/profilpic')
            .then( res =>{
                console.log(res);
            })
            .catch( err =>{
                console.log(err);
            })
    })
}
export default Creators;
